import {createContext,useContext } from "react";
const dropContext = createContext();


function Dropvalue(){
    const value = useContext(dropContext)
    return value
}

function DropContext({children}){
    
    return(
        <>
            <dropContext.Provider >
            {children}
            </dropContext.Provider>
        </>
        
    )
}

export {Dropvalue,DropContext}
